parameters.jsCode:
// Trong Code node
const items = $input.all();

return items.map(item => {
  const dateStr = item.json["Ngày đăng"];   // "14/04/2025"
  const timeStr = item.json["Giờ đăng"];    // "01:00"

  // Chuyển về định dạng chuẩn ISO
  const [day, month, year] = dateStr.split('/');
  const publishAt = new Date(`${year}-${month}-${day}T${timeStr}:00+07:00`); // giả sử múi giờ VN

  return {
    json: {
      ...item.json,
      publishDateTime: publishAt.toISOString()
    }
  };
});

